public boolean equals(Object obj) {
  if (obj == this) {
    return true;
  } else if (obj == null || !(obj instanceof EnumDoubles)) {
    return false;
  }
  final EnumDoubles<?> that = (EnumDoubles<?>)obj;
  return this.enumClass == that.enumClass
      && Arrays.equals(this.doubles, that.doubles);
}
